async function createContact(attorney) {
  const response = await client.post('/crm/v3/objects/contacts', {
    properties: {
      email: attorney.email,
      firstname: attorney.firstName,
      lastname: attorney.lastName,
      phone: attorney.phone,
      company: attorney.company,
      hubspot_owner_id: OWNER_ID,
      hs_lead_status: 'NEW'
    }
  });
  return response.data;
}

async function uploadAttorneys() {
  console.log(`Uploading ${attorneys.length} attorneys to HubSpot...\n`);

  let success = 0;
  let failed = 0;
  let batch = 0;

  for (const attorney of attorneys) {
    try {
      process.stdout.write(`[${++batch}/${attorneys.length}] ${attorney.firstName} ${attorney.lastName}... `);
      await createContact(attorney);
      success++;
      console.log('');
      await new Promise(r => setTimeout(r, 150));
    } catch (error) {
      failed++;
      const msg = error.response?.data?.message || error.message;
      if (msg.includes('already exists')) {
        console.log('(exists)');
      } else {
        console.log(` ${msg.substring(0, 50)}`);
      }
    }
  }

  console.log(`\n${'='.repeat(50)}`);
  console.log(`Done! Success: ${success}, Failed/Exists: ${failed}`);
}

uploadAttorneys();
